        <Route path = "/logout" element = {<Logout />}></Route>
        <Route path = "/register2fa" element = {<TwoFactor />}></Route>
        <Route path = "/logs" element = {<Logs />}></Route>
      </Routes>
    </div>
  );
}

export default App;
